'use strict';
class PriceTerminalData {
    priceTerminal;
    priceSession;
    static create(priceTerminal, priceSession) {
        let result;
        result = new PriceTerminalData();
        result.priceTerminal = priceTerminal;
        result.priceSession = priceSession;
        return result;
    }
    getPriceTerminal() {
        return this.priceTerminal;
    }
    getPriceSession() {
        return this.priceSession;
    }
}
module.exports = PriceTerminalData
